INSERT INTO `ec_products` VALUES (1,'Cyan Boheme','Short Hooded Coat features a straight body, large pockets with button flaps, ventilation air holes, and a string detail along the hemline.','<p>Short Hooded Coat features a straight body, large pockets with button flaps, ventilation air holes, and a string detail along the hemline. The style is completed with a drawstring hood, featuring Rains&rsquo; signature built-in cap. Made from waterproof, matte PU, this lightweight unisex rain jacket is an ode to nostalgia through its classic silhouette and utilitarian design details.</p>\r\n\r\n<p>- Casual unisex fit</p>\r\n\r\n<p>- 64% polyester, 36% polyurethane</p>\r\n\r\n<p>- Water column pressure: 4000 mm</p>\r\n\r\n<p>- Model is 187cm tall and wearing a size S / M</p>\r\n\r\n<p>- Unisex fit</p>\r\n\r\n<p>- Drawstring hood with built-in cap</p>\r\n\r\n<p>- Front placket with snap buttons</p>\r\n\r\n<p>- Ventilation under armpit</p>\r\n\r\n<p>- Adjustable cuffs</p>\r\n\r\n<p>- Double welted front pockets</p>\r\n\r\n<p>- Adjustable elastic string at hempen</p>\r\n\r\n<p>- Ultrasonically welded seams</p>\r\n\r\n<p>This is a unisex item, please check our clothing &amp; footwear sizing guide for specific Rains jacket sizing information. RAINS comes from the rainy nation of Denmark at the edge of the European continent, close to the ocean and with prevailing westerly winds; all factors that contribute to an average of 121 rain days each year. Arising from these rainy weather conditions comes the attitude that a quick rain shower may be beautiful, as well as moody- but first and foremost requires the right outfit. Rains focus on the whole experience of going outside on rainy days, issuing an invitation to explore even in the most mercurial weather.</p>','published','[\"products\\/541.jpg\",\"product-categories\\/2.jpg\",\"products\\/1-b.jpg\",\"products\\/1.jpg\"]',NULL,0,15,0,1,1,NULL,NULL,0,0,0,0,100000,75000,NULL,NULL,10.00,20.00,15.00,1000.00,NULL,NULL,NULL,NULL,NULL,1,0,'